import React from 'react'
import './404.css'

const NotFound = () => {
  return (
    <div>
      <h1 className="title_404">404</h1>
      <p className="description_404">
        This page does not exist or is not available at the moment.
      </p>
    </div>
  )
}

export default NotFound
